import React from "react";

import "./styles.css";

const StartCTAComponent = () => {
  return (
    <section class="section">
      <div class="container">
        <div class="row justify-content-center">
          <div class="col-lg-7">
            <div class="text-center">
              <h2 class="mb-4">
                Navegue Por Nossas{" "}
                <span class="text-warning fw-bold">150+</span> Vagas
              </h2>
              <p class="text-muted">
                Todos os dias temos novas vagas publicadas, encontre o estágio
                perfeito para você. Iremos rapidamente combiná-lo com as
                empresas certas.
              </p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default StartCTAComponent;
